import {Routes, Route} from 'react-router-dom'
import AddBook from './Component/Add_Book';
import BookList from './Component/Book_List'
import Book_Details from './Component/Book_Details';

function App() {
  return (
      <div>
        <Routes>
         <Route path='/' element={ <BookList/> } />
          <Route path='add_book' element={ <AddBook/> } />
          <Route path='book_details' element={ <Book_Details/> } />
        </Routes>
      </div>
  );
}

export default App;
